import React from "react";
import styled from "styled-components/native";

const Container = styled.View`
  border-bottom-width: 1px;
  border-bottom-color: rgba(1, 1, 1, 0.2);
  margin: 0 20px;
`;

const Border = () => (
    <Container></Container>
);

export default Border;
